  false,\n\t\"url\": null,\n\t\"notes\": \"The policy of the U.S. Fish and Wildlife
  Service is to maintain a capability to coordinate, cooperate in, and/or carry out
  search and rescue (SAR) activities on lands which it administers (8 RM 15.1). The
  primary concern for all SAR activities is to protect human life through both a preventive
  and an active program. The limited staff and equipment on Minnesota Valley NWR restricts
  the degree to which the refuge can respond to a search and rescue operation. How
  the refuge responds will depend on the nature of the problem. In short, for all
  but the simplest operations, the refuge will contact the appropriate local  governmental
  unit and coordinate SAR operations with them.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
